INSERT INTO `info` VALUES ('3', '1', 'Tuyển đại lý', 'SITE_DELIVERY', '', '<p>Do nhu cầu mở rộng thị trường, hiện Jeans Nam HN Store đang cần t&igrave;m đối t&aacute;c tr&ecirc;n to&agrave;n quốc hợp t&aacute;c l&agrave;m nh&agrave; ph&acirc;n phối, đại l&yacute; để ph&acirc;n phối c&aacute;c sản phẩm thời trang nam với mức chiết khấu cao c&ugrave;ng c&aacute;c ch&iacute;nh s&aacute;ch đ&atilde;i ngộ hấp dẫn:</p>\r\n\r\n<p>- Chiết khấu cao tr&ecirc;n doanh số mua v&agrave;o</p>\r\n\r\n<p>- Hỗ trợ vận chuyển tr&ecirc;n to&agrave;n quốc</p>\r\n\r\n<p>- H&agrave;ng tự chạy, kh&ocirc;ng lo về b&aacute;n h&agrave;ng</p>\r\n\r\n<p>- Vốn &iacute;t, lợi nhuận nhiều, rủi ro = 0</p>\r\n\r\n<p>- Đặc biệt kh&ocirc;ng &aacute;p đặt doanh số, đại l&yacute; c&oacute; thể nhập h&agrave;ng tuỳ v&agrave;o nhu cầu đầu ra của sản phẩm</p>\r\n\r\n<p><strong>Mọi th&ocirc;ng tin chi tiết vui l&ograve;ng li&ecirc;n hệ về:</strong><br />\r\n<br />\r\nCS1: BT L15-17 Khu đ&ocirc; thị mới Dương Nội KM4 - Đường Tố Hữu - H&agrave; Đ&ocirc;ng - H&agrave; Nội.<br />\r\nCS2: Số 15 L&ecirc; Văn Thi&ecirc;m - Nh&acirc;n Ch&iacute;nh - Thanh Xu&acirc;n - H&agrave; Nội.<br />\r\nĐT: 0913922986 - 0982232183</p>', null, '1437214604', '3', '1', 'Tuyển đại lý bán hàng trực tuyến', 'Tuyển đại lý bán hàng trực tuyến', 'Tuyển đại lý bán hàng trực tuyến');
