INSERT INTO `statics` VALUES ('2', null, 'Giới thiệu', '534', 'Giới thiệu', 'gioi-thieu', 'Xã hội ngày càng phát triển, cuộc sống ngày càng được nâng cao và những nhu cầu tiện nghi cho cuộc sống con người cũng vì thế mà nâng lên, kèm theo đó là nhu cầu mua sắm tiêu dùng phục vụ cho cuộc sống ngày càng lớn. Jeans Nam HN Store được xây dựng nhằm mục đích cung cấp tốt nhất về các mặt hàng thời trang nam tới quý khách hàng.', '<p>X&atilde; hội ng&agrave;y c&agrave;ng ph&aacute;t triển, cuộc sống ng&agrave;y c&agrave;ng được n&acirc;ng cao v&agrave; những nhu cầu tiện nghi cho cuộc sống con người cũng v&igrave; thế m&agrave; n&acirc;ng l&ecirc;n, k&egrave;m theo đ&oacute; l&agrave; nhu cầu mua sắm ti&ecirc;u d&ugrave;ng phục vụ cho cuộc sống ng&agrave;y c&agrave;ng lớn. Jeans Nam HN Store được x&acirc;y dựng nhằm mục đ&iacute;ch cung cấp tốt nhất về c&aacute;c mặt h&agrave;ng thời trang nam tới qu&yacute; kh&aacute;ch h&agrave;ng.</p>\r\n\r\n<p><strong>- Với đội ngũ nh&acirc;n vi&ecirc;n kinh doanh online:</strong> &Acirc;n cần, chu đ&aacute;o, c&oacute; kinh nghiệm v&agrave; hiểu biết về sản phẩm sẵn s&agrave;ng tư vấn gi&uacute;p bạn c&oacute; sự lựa chọn ph&ugrave; hợp nhất, chi ph&iacute; nhỏ nhất, hơn thế nữa đội ngũ nh&acirc;n vi&ecirc;n ch&uacute;ng t&ocirc;i cũng đang hoạt động v&agrave; l&agrave; th&agrave;nh vi&ecirc;n bu&ocirc;n b&aacute;n uy t&iacute;n, t&iacute;ch cực tr&ecirc;n c&aacute;c diễn đ&agrave;n như lamchame, webtretho,.....hay c&aacute;c trang rao vặt 5giay, rongbay, enbac....</p>\r\n\r\n<p><strong>- Đội ngũ IT chuy&ecirc;n nghiệp:</strong> Nghi&ecirc;n cứu tối ưu h&oacute;a website sao cho th&acirc;n thiện nhất với kh&aacute;ch h&agrave;ng, gi&uacute;p kh&aacute;ch h&agrave;ng c&oacute; thể tra cứu th&ocirc;ng tin tr&ecirc;n website một c&aacute;c dễ d&agrave;ng v&agrave; thuận tiện nhất.</p>\r\n\r\n<p><strong>- Đội ngũ nh&acirc;n vi&ecirc;n giao h&agrave;ng:</strong> Tận t&igrave;nh chu đ&aacute;o, chuy&ecirc;n nghiệp lu&ocirc;n sẵn s&agrave;ng đ&aacute;p ứng mọi y&ecirc;u cầu thời gian của kh&aacute;ch h&agrave;ng.</p>\r\n\r\n<p>Qu&yacute; kh&aacute;ch c&oacute; thể li&ecirc;n hệ v&agrave; trao đổi với những chuy&ecirc;n vi&ecirc;n của bộ phận chăm s&oacute;c kh&aacute;ch h&agrave;ng, hoặc gọi điện trực tiếp đến Hotline của ch&uacute;ng t&ocirc;i để được tư vấn, giải đ&aacute;p c&aacute;c vấn đề sản phẩm, hướng dẫn mua h&agrave;ng.</p>\r\n\r\n<p>Ch&uacute;ng t&ocirc;i lu&ocirc;n mong muốn phục vụ kh&aacute;ch h&agrave;ng một c&aacute;ch tốt nhất, chu đ&aacute;o v&agrave; chuy&ecirc;n nghiệp nhất.</p>\r\n\r\n<p>Đội ngũ chăm s&oacute;c kh&aacute;ch h&agrave;ng của Jeans Nam HN Store lu&ocirc;n sẵn s&agrave;ng hỗ trợ kh&aacute;ch h&agrave;ng 24h/ng&agrave;y v&agrave; 7 ng&agrave;y/tuần.</p>\r\n\r\n<p><strong>TH&Ocirc;NG TIN LI&Ecirc;N HỆ:</strong></p>\r\n\r\n<p><strong>CS1:</strong> BT L15-17 Khu đ&ocirc; thị mới Dương Nội KM4 - Đường Tố Hữu - H&agrave; Đ&ocirc;ng - H&agrave; Nội.</p>\r\n\r\n<p><strong>CS2:</strong> Số 15 L&ecirc; Văn Thi&ecirc;m - Nh&acirc;n Ch&iacute;nh - Thanh Xu&acirc;n - H&agrave; Nội.</p>\r\n\r\n<p><strong>ĐT:</strong> 0913922986 - 0982232183</p>', null, null, '1480324746', '1', '1', 'Giới thiệu', 'Giới thiệu', 'Giới thiệu');
INSERT INTO `statics` VALUES ('3', null, 'Bảo mật thông tin', '534', 'Giới thiệu', 'gioi-thieu', 'Bằng việc mua hàng trên website, đăng ký thành viên, người dùng đồng ý với các điều khoản sử dụng và các quy định mà Jeans Nam HN Store đưa ra. Jeans Nam HN Store có quyền đưa ra các thay đổi trong điều khoản sử dụng, các quy định mà không cần báo trước cho người dùng.', '<p>Bằng việc mua h&agrave;ng tr&ecirc;n website, đăng k&yacute; th&agrave;nh vi&ecirc;n, người d&ugrave;ng đồng &yacute; với c&aacute;c điều khoản sử dụng v&agrave; c&aacute;c quy định m&agrave; Jeans Nam HN Store đưa ra. Jeans Nam HN Store c&oacute; quyền đưa ra c&aacute;c thay đổi trong điều khoản sử dụng, c&aacute;c quy định m&agrave; kh&ocirc;ng cần b&aacute;o trước cho người d&ugrave;ng. Sau bất cứ thay đổi n&agrave;o về điều khoản sử dụng v&agrave; quy định m&agrave; người d&ugrave;ng vẫn tiếp tục sử dụng website Jeans Nam HN Store, coi như người d&ugrave;ng đồng &yacute; ho&agrave;n to&agrave;n với c&aacute;c thay đổi đ&oacute;.</p>\r\n\r\n<p>Khi sử dụng website Jeans Nam HN Store v&agrave; c&aacute;c dịch vụ m&agrave; n&oacute; cung cấp, người d&ugrave;ng c&oacute; tr&aacute;ch nhiệm tự bảo quản mật khẩu v&agrave; c&aacute;c th&ocirc;ng tin c&aacute; nh&acirc;n của m&igrave;nh. Jeans Nam HN Store sẽ lu&ocirc;n cố gắng để website v&agrave; dịch vụ của m&igrave;nh lu&ocirc;n lu&ocirc;n hoạt động 24 giờ một ng&agrave;y nhưng sẽ c&oacute; những trường hợp website cần được bảo tr&igrave;, n&acirc;ng cấp hay gặp sự cố ngo&agrave;i &yacute; muốn. Với những trường hợp đ&oacute;, Jeans Nam HN Store sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm khi người d&ugrave;ng kh&ocirc;ng thể truy cập website.</p>\r\n\r\n<p>Jeans Nam HN Store c&oacute; to&agrave;n quyền thay đổi c&aacute;c điều khiển sử dụng hay c&aacute;c quy định, thể lệ li&ecirc;n quan tới từng mặt h&agrave;ng cụ thể tr&ecirc;n website. Thay đổi đ&oacute; c&oacute; thể bao gồm cả nội dung mặt h&agrave;ng.</p>\r\n\r\n<p>Để đăng k&yacute; mua h&agrave;ng người d&ugrave;ng phải l&agrave; c&ocirc;ng d&acirc;n Việt Nam v&agrave; đang sinh sống tr&ecirc;n l&atilde;nh thổ Việt Nam. Người d&ugrave;ng c&oacute; tr&aacute;ch nhiệm bảo vệ số điện thoại, địa chỉ email hay c&aacute;c h&igrave;nh thức li&ecirc;n lạc kh&aacute;c m&agrave; Jeans Nam HN Store y&ecirc;u cầu để nhận được c&aacute;c th&ocirc;ng b&aacute;o từ Jeans Nam HN Store.</p>', null, null, '1480325293', '2', '1', 'Bảo mật thông tin', 'Bảo mật thông tin', 'Bảo mật thông tin');
