INSERT INTO `statics` VALUES ('7', null, 'Giao hàng và cước phí', '535', 'Hỗ trợ', 'ho-tro', '', '<p><strong>1.Giao h&agrave;ng</strong><br />\r\nSau 2-4 ng&agrave;y bạn đặt h&agrave;ng, sản phẩm bạn mua sẽ được giao tận tay bạn ở nh&agrave; hoặc bất cứ địa điểm n&agrave;o bạn muốn trong giờ h&agrave;nh ch&iacute;nh (Từ 8h s&aacute;ng đến 17h chiều).</p>\r\n\r\n<p><strong>2.Ph&iacute; vận chuyển:</strong><br />\r\n1.Nội th&agrave;nh H&agrave; Nội: 30.000 đ<br />\r\n2.Ngoại th&agrave;nh v&agrave; C&aacute;c tỉnh kh&aacute;c : 40.000 đ.</p>', null, null, '1480325411', '3', '1', 'Giao hàng và cước phí', 'Giao hàng và cước phí', 'Giao hàng và cước phí');
INSERT INTO `statics` VALUES ('8', null, 'Phương thức thanh toán', '535', 'Hỗ trợ', 'ho-tro', 'CS1: BT L15-17 Khu đô thị mới Dương Nội KM4 - Đường Tố Hữu - Hà Đông - Hà Nội.\r\nCS2: Số 15 Lê Văn Thiêm - Nhân Chính - Thanh Xuân - Hà Nội.\r\nĐT: 0913922986 - 0982232183', '<p><strong>1.Thanh to&aacute;n bằng h&igrave;nh thức chuyển khoản:</strong><br />\r\n<em><strong>Ng&acirc;n h&agrave;ng Vietinbank:</strong></em><br />\r\n- Số TK: 711A.696.8118.1<br />\r\n- Chủ TK: Nguyễn Xu&acirc;n Duy<br />\r\n- Chi nh&aacute;nh Đền H&ugrave;ng - Ph&uacute; Thọ<br />\r\n<strong>2.Thanh to&aacute;n tại nh&agrave; (Khi nhận được h&agrave;ng bạn chỉ cần gửi tiền cho người giao h&agrave;ng vừa tiết kiệm thời gian vừa an to&agrave;n)</strong><br />\r\n<strong>3.Kh&aacute;ch h&agrave;ng c&oacute; thể nhận sản phẩm v&agrave; thanh to&aacute;n tại văn ph&ograve;ng của Jeans Nam HN Store:</strong><br />\r\nCS1: BT L15-17 Khu đ&ocirc; thị mới Dương Nội KM4 - Đường Tố Hữu - H&agrave; Đ&ocirc;ng - H&agrave; Nội.<br />\r\nCS2: Số 15 L&ecirc; Văn Thi&ecirc;m - Nh&acirc;n Ch&iacute;nh - Thanh Xu&acirc;n - H&agrave; Nội.<br />\r\nĐT: 0913922986 - 0982232183</p>', null, null, '1480325422', '4', '1', 'Phương thức thanh toán', 'Phương thức thanh toán', 'Phương thức thanh toán');
INSERT INTO `statics` VALUES ('9', null, 'Hướng dẫn mua hàng', '535', 'Hỗ trợ', 'ho-tro', '', '<p>Bước 1: Lựa chọn mẫu sản phẩm ưng &yacute; tr&ecirc;n website: Jeans Nam HN Store<br />\r\nBước 2: Điền đầy đủ th&ocirc;ng tin v&agrave;o &ocirc; nhập v&agrave; số lượng bạn muốn mua<br />\r\nBước 3: Gửi đơn h&agrave;ng: Sau khi điền xong bạn bấm v&agrave;o n&uacute;t GỬI ĐƠN H&Agrave;NG</p>', '02-34-30-19-07-2017-logo.jpg', '', '1480325436', '5', '1', 'Hướng dẫn mua hàng', 'Hướng dẫn mua hàng', 'Hướng dẫn mua hàng');
